import React from "react";

const StateBlock = () => {
  return (
    <div
      style={{
        width: "45vw",
        height: "20vh",
        display: "grid",
        gridTemplateColumns: "repeat(3, 1fr)",
        gridGap: ".5rem",
        outline: "1px solid black",
      }}
    ></div>
  );
};

export default StateBlock;
